import React from 'react';
import './App.css';
import { connect } from 'react-redux';
import {nameData} from './actions/formActions'
import { Container } from '@material-ui/core';
import Typography from '@material-ui/core/Typography';
import TextField from '@material-ui/core/TextField';
import Box from '@material-ui/core/Box';

import { makeStyles } from '@material-ui/core/styles';

class App extends React.Component{


  classes = makeStyles({
    root: {
      width: '35%'
    },
  })();


  doThing = () => {
    this.props.dispatch(nameData({firstName:'Max', middleName: 'tonk', lastName:'Payne'}))
  }

  render(){
    return (
      <Container maxWidth="md">
            <Typography component="div" style={{ backgroundColor: '#ccf0e1', height: '80vh', marginTop:'10vh' }}>
              <form noValidate autoComplete="off">
                <Box 
                display="flex"
                flexDirection="column"
                alignItems="center"
                >
                    <TextField className={this.classes.root} id="filled-basic" label="Filled" variant="filled" style={{width: '35%'}}/>
                    <TextField id="outlined-basic" label="Outlined" variant="outlined" />
                </Box>
              </form>
            </Typography>
      </Container>
    );
  }
}

function mapStateToProps(state){
  return state;
}

export default connect(mapStateToProps)(App);
